/**
 * Draws an array from (0, 0) to (w-1, h-1);
 * */
var drawArr = function(arr, w, h) {
    for(var y = 0; y < h; y++) {
        for(var x = 0; x < w; x++) {
            var color = arr[x + y * w] - 2147483647;
            var b = color % 256;
            var g = (color >> 8) % 256;
            var r = (color >> 16) % 256;
            var o = (color >> 24) % 256;
            stroke(r, g, b, o);
            strokeWeight(0.1);
            point(x, y);
        }
    }
};

background(255, 255, 255);
drawArr(cage, cagew, cageh);

var mouseMoved = function() {
    background(255, 255, 255);
    pushMatrix();
    translate(mouseX - cagew / 2, mouseY - cageh / 2);
    drawArr(cage, cagew, cageh);
    popMatrix();
};
